table.Comment:
1) 区域警报事件：type=1,addrsssid为发生事件的区域ID,status 对应geo_config_list 的mode,eventid 对应geo_config_list的geo_config_id;
2) 出入警报事件：type=2,addrsssid为发生事件的出入口ID即gw_pair_list 的gw_pair_id,status 对应gw_pair_list的inout_alarm_status,eventid 对应gw_pair_list 的gw_pair_id;
3)请假超时警报事件：type=5,addrsssid为发生事件的请假ID即vacation_list 的vac_id,status为1即代表超时,eventid 对应vacation_list 的vac_id,;
